import React from 'react';
import './Table.css';

export default function Table({ passCourses, suggestedSubjects }) {
  console.log("ðŸ“¦ From Props - Passed Courses:", passCourses);
  console.log("ðŸ“¦ From Props - Suggested Subjects:", suggestedSubjects);

  return (
    <div className="table-container">
      <div className="courses-section">
        <h3>âœ… Passed Courses</h3>
        {passCourses && passCourses.length > 0 ? (
          <ul className="courses-list">
            {passCourses.map((course, index) => (
              <li key={index}>{course}</li>
            ))}
          </ul>
        ) : (
          <p className="no-courses">No passed courses found</p>
        )}
      </div>

      <div className="courses-section">
        <h3>ðŸ’¡ Suggested Subjects for Registration</h3>
        {suggestedSubjects && suggestedSubjects.length > 0 ? (
          <ul className="courses-list">
            {suggestedSubjects.map((subject, index) => (
              <li key={index}>{subject}</li>
            ))}
          </ul>
        ) : (
          <p className="no-courses">No suggested subjects found</p>
        )}
      </div>
    </div>
  );
}

